  "Initiated By" : "CONNECTICUT",
  "Allegations" : "ON MARCH 4, 2011, THE CONNECTICUT BANKING COMMISSIONER ISSUED AN ORDER TO CEASE AND DESIST, NOTICE OF INTENT TO FINE AND NOTICE OF RIGHT TO HEARING (DOCKET NO. CF-11-7719-S) AGAINST DANIEL QUENTIN HUMPHREY, CURRENTLY OF 108 BORDEAUX LANE, ALPINE, UTAH; FINITY FINANCIAL GROUP, LLC OF 708 SOUTH AVENUE, NEW CANAAN, CONNECTICUT, AN ENTITY OF WHICH HUMPHREY WAS A MEMBER; WATERFORD LOAN FUND, LLC, A SECURITIES ISSUER LOCATED AT 215 SOUTH STATE STREET, SUITE 550, SALT LAKE CITY, UTAH; OASIS PROPERTIES I, LLC, AN ISSUER OF SECURITIES LOCATED AT 1055 WEST RED CLIFF DRIVE, C-517, WASHINGTON, UTAH; AND SCOTT L. WILSON, MANAGER OF OASIS PROPERTIES I, LLC.  THE ACTION ALLEGED THAT:  1) BETWEEN 2002 AND 2005, RESPONDENT HUMPHREY ENGAGED IN PRIVATE SECURITIES TRANSACTIONS WITHOUT NOTICE TO HIS EMPLOYING BROKER-DEALER BY SELLING UNREGISTERED PROMISSORY NOTES ISSUED BY RESPONDENT WATERFORD LOAN FUND, LLC; 2) RESPONDENT HUMPHREY VIOLATED SECTION 36B-6(A) OF THE CONNECTICUT UNIFORM SECURITIES ACT BY ACTING AS AN UNREGISTERED AGENT OF ISSUER OF WATERFORD LOAN FUND, LLC; 3) RESPONDENT WATERFORD LOAN FUND, LLC VIOLATED SECTIONS 36B-16 AND 36B-6(B) OF THE ACT BY SELLING UNREGISTERED SECURITIES AND EMPLOYING RESPONDENT HUMPHREY AS AN UNREGISTERED AGENT OF ISSUER; 4) RESPONDENT HUMPHREY TRANSACTED BUSINESS AS AN UNREGISTERED AGENT OF ISSUER OF OASIS PROPERTIES I, LLC IN CONJUNCTION WITH AN OFFERING OF THAT ENTITY'S SERIES C NOTES; 5) OASIS PROPERTIES I, LLC VIOLATED SECTION 36B-6(B) OF THE ACT BY EMPLOYING RESPONDENT HUMPHREY AS AN UNREGISTERED AGENT OF ISSUER; 6) OASIS PROPERTIES I, LLC AND RESPONDENT WILSON VIOLATED SECTION 36B-16 OF THE ACT BY SELLING UNREGISTERED SERIES F SECURED PROMISSORY NOTES; AND 7) FROM AT LEAST 2006 FORWARD, RESPONDENT HUMPHREY, ALONE AND DOING BUSINESS AS FINITY FINANCIAL GROUP (A SOLE PROPRIETORSHIP) AND FINITY FINANCIAL GROUP, LLC, TRANSACTED BUSINESS AS AN INVESTMENT ADVISER IN CONNECTICUT ABSENT REGISTRATION.",
